import styled from '@emotion/styled';

const ImgContainer = styled.div`
  width: 100%;
  position: relative;
`;

const Img = styled.img`
  width: 100%;
  height: auto;

  object-fit: cover;
`;

const Title = styled.div`
  display: flex;
  align-items: center;
  justify-content: space-between;
  margin-top: 15px;
  margin-bottom: 15px;
`;

const ModalContent = (
  carClassId,
  carImage,
  carClassName,
  maker,
  carModel,
  fuel,
  gearbox,
  capacity,
  safetyOption,
  additionalOption,
) => {
  return (
    <div>
      <ImgContainer>
        <Img src={carImage} alt={`${carClassName} 차량`} />
      </ImgContainer>
      <Title>{carClassName}</Title>
      {maker}
      {carModel}
      {fuel}
      {gearbox}
      {capacity}
      안전 옵션
      {safetyOption}
      편의 옵션
      {additionalOption}
    </div>
  );
};

export default ModalContent;
